  const texts = [{"value":"Here are some dumi-theme-chaos common questions and official answers for your reference.","paraId":0},{"value":"0.3.0+","paraId":1},{"value":"The home page of ","paraId":2,"tocIndex":0},{"value":"dumi-theme-chaos","paraId":2,"tocIndex":0},{"value":" is generated according to the configuration by default, and there will inevitably be some custom modules in the actual use process. ","paraId":2,"tocIndex":0},{"value":"dumi-theme-chaos","paraId":2,"tocIndex":0},{"value":" internally separates the home page module into a built-in component of ","paraId":2,"tocIndex":0},{"value":"HomeBaseLayout","paraId":2,"tocIndex":0},{"value":", if you want While fully customizing the homepage and wanting to retain the layout of the built-in homepage, it can be introduced and used in the page. For example, to create a new page:","paraId":2,"tocIndex":0},{"value":"<!-- .dumi/pages/index.md -->\n\n<HomeBaseLayout></HomeBaseLayout>\n....some text or images\n<YourCustomComponent></YourCustomComponent>\n","paraId":3,"tocIndex":0},{"value":"Or import it as a React component:","paraId":4,"tocIndex":0},{"value":"/*.dumi/pages/index.tsx */\nimport { HomeBaseLayout } from 'dumi-theme-chaos';\n\nconst CustomHomePage = () => {\n  return (\n    <div>\n      <HomeBaseLayout />\n      <div>other content</div>\n    </div>\n  );\n};\n\nexport default CustomHomePage;\n","paraId":5,"tocIndex":0},{"value":"0.3.3+","paraId":6,"tocIndex":0},{"value":"The theme package has been adapted to the conventional secondary navigation function provided by dumi, which is convenient for organizing documents. For the specific directory structure and FrontMatter configuration, please refer to the official website ","paraId":7,"tocIndex":1},{"value":"Conventional secondary navigation","paraId":7,"tocIndex":1},{"value":"。","paraId":7,"tocIndex":1},{"value":"The theme switching logic inside the theme package is compatible with dumi’s built-in ","paraId":8,"tocIndex":2},{"value":"usePrefersColor","paraId":8,"tocIndex":2},{"value":" API, so you can use the ","paraId":8,"tocIndex":2},{"value":"@dark-selector","paraId":8,"tocIndex":2},{"value":" global variable in the Less file to add a dark mode style to the components of the theme package:","paraId":8,"tocIndex":2},{"value":".some-container {\n  // Bright color mode is white\n  color: #fff;\n\n  // dark mode is black\n  @{dark-selector} & {\n    color: #000;\n  }\n}\n","paraId":9,"tocIndex":2},{"value":"If it is a pure css file, you can use ","paraId":10,"tocIndex":2},{"value":"prefers-color-scheme","paraId":10,"tocIndex":2},{"value":" to achieve.","paraId":10,"tocIndex":2},{"value":"0.3.9+","paraId":11,"tocIndex":2},{"value":"The theme package supports ssr, and the cssinjs' style was not completely compatible before the ` 0.3.9' version, but the problem has been fixed in later versions. SSR recommends the following configuration:","paraId":12,"tocIndex":3},{"value":"export default defineConfig({\n  ssr: process.env.NODE_ENV === 'development' ? false : {}\n});\n","paraId":13,"tocIndex":3},{"value":"When configured as SSR, if the homepage uses the built-in homepage module of the theme package, a 404 routing page will appear briefly when it is loaded for the first time. The reason is that the built-in homepage did not export ","paraId":14},{"value":"index.html","paraId":14},{"value":". is not immediately loaded into the corresponding resource. The solution is to create a custom homepage, then import the built-in ","paraId":14},{"value":"<HomeBaseLayout />","paraId":14},{"value":" module of the theme package, and then package and export","paraId":14},{"value":"index.html","paraId":14},{"value":", you can refer to [dumi-theme-chaos official website homepage](https:// github.com/chaos-design/dumi-theme-chaos/blob/main/example/.dumi/pages/index/index.tsx).","paraId":14},{"value":"index.html","paraId":15},{"value":"After using ","paraId":16,"tocIndex":4},{"value":"dumi-theme-chaos","paraId":16,"tocIndex":4},{"value":" theme package, the homepage is generated through configuration, and ","paraId":16,"tocIndex":4},{"value":"index.md","paraId":16,"tocIndex":4},{"value":" is not written, so ","paraId":16,"tocIndex":4},{"value":"index.html","paraId":16,"tocIndex":4},{"value":" will not be generated. If you want to generate ","paraId":16,"tocIndex":4},{"value":"index.html","paraId":16,"tocIndex":4},{"value":", you can add ","paraId":16,"tocIndex":4},{"value":"index.md","paraId":16,"tocIndex":4},{"value":" or completely customize the home page, and then import the built-in ","paraId":16,"tocIndex":4},{"value":"HomeBaseLayout","paraId":16,"tocIndex":4},{"value":" component.","paraId":16,"tocIndex":4},{"value":"When deploying GitHub Pages, it will search for the ","paraId":17},{"value":"index.html","paraId":17},{"value":" file step by step by default. If you use nginx deployment, you can configure ","paraId":17},{"value":"try_files","paraId":17},{"value":" related parameters. When ","paraId":17},{"value":"index.html","paraId":17},{"value":" cannot be found in the root directory, it will go to other directories to find","paraId":17},{"value":" index.html","paraId":17},{"value":".","paraId":17}];
  

