  const texts = [{"value":"The font system is one of the most foundational parts of any interface design.","paraId":0},{"value":"Text is a major channel for users to understand application content and complete their work, and a well designed font system will greatly enhance the user's reading experience and work efficiency. The Ant Design typography system is based on the design principle of \"dynamic order\" combined with the law of natural logarithm and temperament. We strongly recommend it since it has been verified by a large number of Ant products. While defining the font system for a visual system, we propose to start from the following five aspects:","paraId":1},{"value":"Font Family","paraId":2},{"value":"Base Font Size","paraId":2},{"value":"Font Scale & Line Height","paraId":2},{"value":"Font Weight","paraId":2},{"value":"Font Color","paraId":2}];
  

